import { ref } from 'vue';

export function useQuizHistory() {
  const quizHistory = ref([]);
  const isLoading = ref(false);
  const error = ref(null);

  const fetchHistory = async (userId) => {
    isLoading.value = true;
    error.value = null;
    try {
      // Here you would make your actual API call
      // For now, we'll simulate fetching quiz history
      await new Promise(resolve => setTimeout(resolve, 1000));
      quizHistory.value = [
        {
          id: '1',
          date: new Date().toISOString(),
          score: 85,
          totalQuestions: 10,
          timeSpent: '12:30',
          category: 'JavaScript'
        },
        // Add more mock data as needed
      ];
      return true;
    } catch (e) {
      error.value = 'Failed to fetch quiz history. Please try again.';
      return false;
    } finally {
      isLoading.value = false;
    }
  };

  const addQuizResult = async (result) => {
    isLoading.value = true;
    error.value = null;
    try {
      // Here you would make your actual API call
      await new Promise(resolve => setTimeout(resolve, 500));
      quizHistory.value.unshift({
        id: Date.now().toString(),
        date: new Date().toISOString(),
        ...result
      });
      return true;
    } catch (e) {
      error.value = 'Failed to save quiz result. Please try again.';
      return false;
    } finally {
      isLoading.value = false;
    }
  };

  const clearHistory = async (userId) => {
    isLoading.value = true;
    error.value = null;
    try {
      // Here you would make your actual API call
      await new Promise(resolve => setTimeout(resolve, 500));
      quizHistory.value = [];
      return true;
    } catch (e) {
      error.value = 'Failed to clear quiz history. Please try again.';
      return false;
    } finally {
      isLoading.value = false;
    }
  };

  return {
    quizHistory,
    isLoading,
    error,
    fetchHistory,
    addQuizResult,
    clearHistory
  };
}
